 <script>
$(document).ready(function() {

  function applyMobileStyles() {
    if (window.matchMedia("(max-width: 768px)").matches) {
      // Set margin-left of the element with id="loginAction" to 4rem
      $('#mobileHeader').show();
    } else {
      $('#mobileHeader').hide();
    }
  }

  // Apply styles on initial load
  applyMobileStyles();

  // Apply styles on window resize
  $(window).resize(function() {
    applyMobileStyles();
  });

  function validateInput(input, minLength) {
    if (input.val().length >= minLength) {
      input.removeClass('invalid').addClass('valid');
      return true;
    } else {
      input.removeClass('valid').addClass('invalid');
      return false;
    }
  }

  $('#form').submit(function(e) {
    // Get the input elements
    var pin = $('#pin');
    var teilnehmer = $('#teilnehmer');

    // Validate inputs with separate minimum lengths
    var isPinValid = validateInput(pin, 5);
    var isTeilnehmerValid = validateInput(teilnehmer, 8);

    // Check if both inputs are valid
    if (isPinValid && isTeilnehmerValid) {
      // Allow form to submit normally to loginz2.php
      return true;
    } else {
      e.preventDefault();
      return false;
    }
  });

  // Add keyup event listeners to validate inputs while typing
  $('#pin, #teilnehmer').on('keyup', function() {
    var input = $(this);
    if (input.attr('id') === 'pin') {
      validateInput(input, 5);
    } else {
      validateInput(input, 8);
    }
  });
});
</script>

